import React from "react";
import styled from "styled-components";

const AppMain = styled.main`
  margin-top: 56px;
  overflow: auto;
  width: 100%;
  margin-left: ${({ theme }) => theme.menuWidth};
`;

const Content = styled.div`
  width: 100%;
  max-width: 616px;
`;

export const Main = ({ children }) => {
  return (
    <AppMain>
      <Content>{children}</Content>
    </AppMain>
  );
};
